let sources = collections[/* lead_sources */ '3a7dd365-0da1-4e98-b854-6b685dbe57bf']?.data || [];
let users = collections[/* users */ 'af758cc2-384e-4fab-9275-8dadd51f5375']?.data || [];

if (!Array.isArray(data) || data.length === 0) {
  console.log("No data to export");
  return;
}

const headers = [
  "الاسم",
  "رقم التليفون",
  "البريد الإلكتروني",
  "الحالة",
  "ملاحظات",
  "تاريخ الإضافة",
  "المصدر",
  "المسؤول"
];

const rows = data.map(item => {
  const sourceObj = sources.find(src => src.id === item.source);
  const userObj = users.find(user => user.id === item.assigned_to);

  const sourceName = sourceObj?.source_name || `ID ${item.source}`;
  const userName = userObj?.user_name || `ID ${item.assigned_to}`;

  return [
    item.client_name || "",
    item.phone || "",
    item.email || "",
    item.status || "",
    item.notes || "",
    item.created_at || "",
    sourceName,
    userName
  ];
});

const csvContent = [
  headers.join(","),
  ...rows.map(row => row.map(value => `"${value}"`).join(","))
].join("\n");

